import React from 'react';
import '../styles/styles.css';

const About = () => {
  return (
    <div className="about">
      <h1>Sobre Mi</h1>
      <p>Mis cualidades técnicas y mi creatividad me ayudan a crear los mejores proyectos.</p>
    </div>
  );
};

export default About;
